import React from 'react';
import s from './styles/Home.module.css';
const Home = () => {
  const imgUrl = 'https://picsum.photos/200';

  return (
    <div className={s.container}>
      <div className={s.wrapper1}></div>
      <img src={imgUrl} style={{ width: 200, height: 200 }} />
    </div>
  );
};

export default Home;
